import React from "react";
import './Home.css';
import {Navbar} from "../../components"

export default function Home() {
    return (
        <main className='page'>
            <header className='header'>
                <Navbar />
            </header>
            <div className="body">
                <img className="bg-photo" src="/public/home-plane-background.jpg" alt=""></img>
            </div>
        </main>
    )
}
